import ReactDOM from 'react-dom';
import './style.css';
import App from './App';

function something(){
  const myFirstName = "Shreyas";
    const myLastName = "Viswanathan";
  return(
    <h1>Hello + " " + {myFirstName} + " " + {myLastName} + "!"</h1>
  )
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
